import React, { Component } from "react";
import { Card, Grid, CardContent, Typography } from '@material-ui/core';

const Display = (props) => {
  props.data.map(item => {
    console.log(item)
  })
  return (
      <div>
      {props.data.map(item =>
          <Card >
            <CardContent>
              <Typography>{item.name}</Typography>
            </CardContent>
          </Card>
        )}
      </div>
  );
}

export default class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
    };
  }

  display = (props) => {
    props.data.map(item => {
      console.log(item)
    })
    return (
        <div>
        {props.data.map(item =>
            <Card >
              <CardContent>
                <Typography>{item.name}</Typography>
              </CardContent>
            </Card>
          )}
        </div>
    );
  }

  getKitchen () {
    fetch("http://localhost:8080/api/kitchen",{
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    })
    .then(res=> res.json())
    .then(data => data.map(item => {
      this.state.items.push(item)
    }))
  }


  componentDidMount() {
    this.getKitchen();
  }

  render() {
    return(
      <div>
      {this.display(this.state.items)}
      </div>
    );
  }
}
